import React from 'react';
import axios from 'axios';
import fs from 'fs'


import './App.css';

class App extends React.Component{


  constructor(){
    super()

    this.state={
      dt:[]
    }
  }

  call(){
    var b=[]
  // let that=this
    axios.get('http://localhost:5000/data')
    .then(function (response) {
      // handle success
      var a=JSON.stringify(response)

      b=a.split(" ")


      console.log(b);

    }).then( this.setState({

      dt:b

    }))
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .finally(function () {
      // always executed
    });


  }


  render(){
    return (
      <div>
        <button onClick={this.call}>submit</button>

        {
          this.state.dt.map(data=>{
            return <p>{data}</p>
          }
          )
        }
      </div>
    )
  }
}
export default App;
